  return (
    <>
    <div className='container'>
      <h1>Latest Products</h1>
      <Row>
        {products.map((product) => (
          <Col xs={6}sm={6} md={6} lg={4} xl={3}>
            <Product product={product} />
          </Col>
        ))}
      </Row>
      </div>
    </>
  )
}

export default HomeScreen
